create table district
(
    id            uuid default uuid_generate_v4() not null
        constraint district_pkey
            primary key,
    created_at    timestamp,
    updated_at    timestamp,
    name_oz       varchar(255),
    name_ru       varchar(255),
    name_uz       varchar(255),
    created_by_id uuid
        constraint fk5l49ee6q1wk3j5ob7og32qg5g
            references users,
    updated_by_id uuid
        constraint fkrkgmm3g5q9o7f633a3poed2f3
            references users,
    region_id     uuid
        constraint fkpjyu66maoe0h5uqfhle85e5vo
            references region
);

alter table district
    owner to u1710009;

